// 错误 dvdf
func longestSubstring(s string) string {

	last := make(map[rune]int) //该字符上一次出现的位置
	startTemp := 0             //距离当前下标不含重复字符的起始下标
	start := 0                 //当前最大不重复子串的起始下标
	maxLength := 0             //当前最大不重复子串的长度
	var res []rune             //存储rune子串

	//获取最长不重复子串的起始位置和长度（start,maxLength）
	st := []rune(s)
	for i, ch := range st {
		if lastI, ok := last[ch]; ok && lastI >= startTemp {
			startTemp = i
		}
		if i+1-startTemp > maxLength {
			maxLength = i + 1 - startTemp
			start = startTemp
		}
		last[ch] = i
	}

	//拼装成字符串并返回
	for j := start; j < start+maxLength; j++ {
		res = append(res, st[j])
	}
	result := string(res)
	return result
}

// 每次出现重复字符时，从前一个继续遍历，并清空map
// 时间复杂度较高，速度较慢
func lengthOfLongestSubstring1(s string) int {
	if len(s) == 0 {
		return 0
	}
	last := make(map[rune]int)
	start := 0
	max := 0

	st := []rune(s)
	for i := 0; i < len(st); {
		if lastI, ok := last[st[i]]; ok {
			start = lastI + 1
			last = make(map[rune]int)
			last[st[start]] = start
			i = start
		}
		last[st[i]] = i
		i++
		if max < i-start {
			max = i - start
		}
	}
	return max
}

// 正确 速度较快
// aQuaYi/LeetCode-in-G
func lengthOfLongestSubstring(s string) int {
	// location[s[i]] == j 表示：
	// s中第i个字符串，上次出现在s的j位置，所以，在s[j+1:i]中没有s[i]
	// location[s[i]] == -1 表示： s[i] 在s中第一次出现
	location := [256]int{} // 只有256长是因为，假定输入的字符串只有ASCII字符
	for i := range location {
		location[i] = -1 // 先设置所有的字符都没有见过
	}

	maxLen, left := 0, 0

	for i := 0; i < len(s); i++ {
		// 说明s[i]已经在s[left:i+1]中重复了
		// 并且s[i]上次出现的位置在location[s[i]]
		if location[s[i]] >= left {
			left = location[s[i]] + 1 // 在s[left:i+1]中去除s[i]字符及其之前的部分
		} else if i+1-left > maxLen {
			// fmt.Println(s[left:i+1])
			maxLen = i + 1 - left
		}
		location[s[i]] = i
	}

	return maxLen
}

// 速度最快
// halfrost/LeetCode-Go
func lengthOfLongestSubstring2(s string) int {
	if len(s) == 0 {
		return 0
	}
	var freq [256]int
	result := 0
	left, right := 0, -1

	for left < len(s) {
		if right+1 < len(s) && freq[s[right+1]] == 0 {
			freq[s[right+1]]++
			right++
		} else {
			freq[s[left]]--
			left++
		}
		result = int(Max(result, right-left+1))
	}
	return result
}

func Max(x, y int) int {
	if x < y {
		return y
	}
	return x
}

// 速度最慢
func lengthOfLongestSubstring3(s string) int {
	st := []rune(s)
	n := len(st)
	var ans int
	for i := 0; i < n; i++ {
		for j := i; j <= n; j++ {
			if allUnique(st, i, j) {
				ans = Max(ans, j-i)
			}
		}
	}
	return ans
}

func allUnique(s []rune, start, end int) bool {
	set := make(map[rune]int)
	for i := start; i < end; i++ {
		if _, ok := set[s[i]]; ok {
			return false
		}
		set[s[i]] = 0
	}
	return true
}

// 正确
func lengthOfLongestSubstring4(s string) int {
	if len(s) == 0 {
		return 0
	}

	last := make(map[rune]int)
	start := 0
	max := 0

	st := []rune(s)
	for i, ch := range st {
		if lastI, ok := last[ch]; ok && lastI >= start {
			start = lastI + 1
		}
		last[ch] = i
		if max < i-start+1 {
			max = i - start + 1
		}
	}
	return max
}

